import React from "react"
import "./navbar_banner.css"
import Display from "./navbar_banner_data"
import left from "./Images/left.png"
import right from "./Images/right.png"
// import { Link } from "react-router-dom"
import Rating from "./Images/rating.jpg"
import Navbar from "./navbar"

export default function Banner(){

const data = Display.map(data=>{

    return(
        <div>
        <BannerData
        name= {data.name}
        img= {data.img}
        description = {data.description}
         />
         <ProductDescription
         name= {data.name}
        img= {data.img}
        description = {data.description}
         />    
        </div>

    )
})


 let i=0

 const [productDisplay,setProductDisplay] = React.useState(data[i],)

//On Click Function
 function Left(){
        if(i==0){
            return(
                setProductDisplay(data[i])
            )
        }
        else{
            setProductDisplay(data[i=i-1])
        }
 }
 function Right(){
    if(i==Display.length-1){
        return(
            setProductDisplay(data[i])
        )
    }
    else{
        setProductDisplay(data[i=i+1])
    }
 }


function BannerData(props){
    if(i==0){
        return(
            <div id="banner">
            <div className="end"></div>

               <div id="banner-text">
               <a>{props.name}</a>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img"  onClick={ProductDescription}>
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>   

            </div>
        )

    }
    else if(i==Display.length-1){
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <a>{props.name}</a>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img"  onClick={ProductDescription}>
                    <img src={props.img} />
                </div> 

              <div className="end"></div>     
            </div>
        )
    }
    else{
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <a>{props.name}</a>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img"  onClick={ProductDescription}>
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>

            </div>
        )
    }

}

   return(
    <div>
         {productDisplay}
    </div>
   )
}      

//  Product-Description
function ProductDescription(props){
    return(
        <div>
            <Navbar />
            <div id="product-top">
                <div id="product-desc">
                    <h1>{props.name}</h1>
                    <a><strong>Rs 249/-</strong></a>
                    <p>{}props.description</p>
                    <img src={Rating} />
                    <button>Add to cart</button> 
                </div>


                <div id="product-image">
                    <img src={props.img} />
                    <div id="more-images">
                        <div className="more-images"></div>
                        <div className="more-images"></div>
                    </div>
                </div>
        </div>
        </div>

    )
}
